# Ensures LogonUI.exe is respawned correctly after we kill it. On Windows non-Server versions, winlogon will automatically
#   respawn LogonUI when it's killed. This doesn't happen on Windows Server, whichs results in a black/freeze login screen.
# Luckily, sending a SAS (software-based Ctrl-Alt-Del) causes the process to respawn and login can continue, so we do that here.
# Sending the SAS doesn't seem to negatively impact systems that don't need the workaround, so just send it unconditionally.
function EnsureLogonUIRespwaned
{
    $CurrentSasConfig = 0
    try {
        $CurrentSasConfig = (Get-ItemProperty $CurrentSystemPolicies).SoftwareSASGeneration
        Set-ItemProperty -Path $CurrentSystemPolicies -Name $SoftwareSAS -Value 3 -Type DWORD
        [WinAPI]::SendSAS($false)
    }
    catch {
        try {
            $ConsoleSessionID = [WinAPI]::WTSGetActiveConsoleSessionId()
            [WinAPI]::SendVistaSASMessage($ConsoleSessionID)
        }
        catch {
        }
    }
    finally {
        Set-ItemProperty -Path $CurrentSystemPolicies -Name $SoftwareSAS -Value $CurrentSasConfig -Type DWORD
    }
}

function DecryptData
{
    Param
    (
        [System.Byte[]]$EncryptedData,
        [System.Byte[]]$Entropy
    )

    $BytesArr = [System.Security.Cryptography.ProtectedData]::Unprotect($EncryptedData, $Entropy, [System.Security.Cryptography.DataProtectionScope]::CurrentUser)
    return $BytesArr
}

# RegisterDLL is programmatic version of Extensions/Continuum Command Integration/ControlCredentialProvider/Register.reg file. Both of them should be in sync.
function RegisterDLL {
    Param
    (
        [String]$CLSID = $CredClassID,
        [String]$DLLPath = $DllFilePath.replace('\\','\')
    )

    if ($CLSID -and $DLLPath) {
        if (Test-Path "$CredProvider\$CLSID"){
            Remove-Item -Path "$CredProvider\$CLSID" -Recurse
        }
        New-Item -Path $CredProvider -Name $CLSID
        Set-Item -Path "$CredProvider\$CLSID"  -Value "ControlCredentialProvider" -Force

        if (Test-Path "$CredClassRoot\$CLSID"){
            Remove-Item -Path "$CredClassRoot\$CLSID" -Recurse
        }
        New-Item -Path $CredClassRoot -Name $CLSID
        Set-Item -Path "$CredClassRoot\$CLSID"  -Value "ControlProvider class" -Force

        New-Item -Path "$CredClassRoot\$CLSID" -Name "InprocServer32"
        Set-Item -Path "$CredClassRoot\$CLSID\InprocServer32"  -Value $DLLPath -Force
        New-ItemProperty -Path "$CredClassRoot\$CLSID\InprocServer32" -Name "ThreadingModel" -Value "Apartment" -PropertyType "String" -Force
    }
}

# UnregisterDLL is programmatic version of Extensions/Continuum Command Integration/ControlCredentialProvider/Unregister.reg file. Both of them should be in sync.
function UnregisterDLL {
    Param
    (
        [String]$CLSID = $CredClassID
    )

    if ($CLSID) {
        if (Test-Path "$CredProvider\$CLSID"){
            Remove-Item -Path "$CredProvider\$CLSID" -Recurse
        }

        if (Test-Path "$CredClassRoot\$CLSID"){
            Remove-Item -Path "$CredClassRoot\$CLSID" -Recurse
        }
    }
}

function GetOperatingSystemName
{
    Param
    (
        [System.int32]$Major,
        [System.int32]$Minor,
        [string]$Version
    )

    $Name = ""
    if ($Major -eq 10) {
        if ($Minor -eq 0) {
            $Name = "Windows 10/ Windows Server 2016"
        }
    }elseif ($Major -eq 6) {
        if ($Minor -eq 3) {
            $Name = "Windows 8.1/ Windows Server 2012 R2"
        }elseif ($Minor -eq 2) {
            $Name = "Windows 8/ Windows Server 2012"
        }elseif ($Minor -eq 1) {
            $Name = "Windows 7/ Windows Server 2008 R2"
        }elseif ($Minor -eq 0) {
            $Name = "Windows Vista/ Windows Server 2008"
        }
    }elseif ($Major -eq 5) {
        if ($Minor -eq 2) {
            $Name = "Windows XP Professional x64 Edition/ Windows Server 2003 R2/ Windows Home Server/ Windows Server 2003"
        }elseif ($Minor -eq 1) {
            $Name = "Windows XP"
        }elseif ($Minor -eq 0) {
            $Name = "Windows 2000"
        }
    }
    return "Major[$Major], Minor[$Minor], Version[$Version], Name[$Name]"
}

function GetFileHashCode
{
    Param
    (
        [String]$FileName
    )

    $FileStream = [System.IO.File]::OpenRead($FileName)
    $Sha256 = [System.Security.Cryptography.SHA256]::Create()
    $FileHash = $Sha256.ComputeHash($FileStream)
    $FileStream.Close()
    return $FileHash
}

function EnsureSafeTempPath
{
    $DirectoryPath = [System.Environment]::GetEnvironmentVariable('TEMP','Machine') + "\ControlCredentialProvider\"
    $DirectoryPath = $DirectoryPath.replace('\','\\')

    $DirInfo = New-Object System.IO.DirectoryInfo $DirectoryPath
    if (!$DirInfo.Exists) {
        $DirInfo.Create()
    }

    $DirSecurity = New-Object System.Security.AccessControl.DirectorySecurity
    $DirSecurity.SetAccessRuleProtection($true, $false)

    $accessRuleSystemAdmin = new-object System.Security.AccessControl.FileSystemAccessRule @(
        (new-object System.Security.Principal.SecurityIdentifier  @([System.Security.Principal.WellKnownSidType]::BuiltinAdministratorsSid,$null)),`
        [System.Security.AccessControl.FileSystemRights]::FullControl,`
        [System.Security.AccessControl.AccessControlType]::Allow
    )
    $accessRuleSystem = new-object System.Security.AccessControl.FileSystemAccessRule @(
        (new-object System.Security.Principal.SecurityIdentifier  @([System.Security.Principal.WellKnownSidType]::LocalSystemSid,$null)),`
        [System.Security.AccessControl.FileSystemRights]::FullControl,`
        [System.Security.AccessControl.AccessControlType]::Allow
    )

    $DirSecurity.AddAccessRule($accessRuleSystemAdmin)
    $DirSecurity.AddAccessRule($accessRuleSystem)
    $DirInfo.SetAccessControl($DirSecurity)

    foreach ($curFile in $DirInfo.GetFiles()) {
        $curFile.Delete()
    }

    foreach ($curSubDirectory in $DirInfo.GetDirectories()) {
        $curSubDirectory.Delete($true)
    }
    return $DirectoryPath
}

function CreateResponseObject {
    Param
    (
        [System.int32]$Status,
        [System.int32]$SubStatus,
        [string]$StatusMessage,
        [string]$SubStatusMessage,
        [string]$DebugTrace
    )

    $ResponseObject = @"
    {
    "status": $Status,
    "subStatus": $SubStatus,
    "statusMessage": "$StatusMessage",
    "subStatusMessage": "$SubStatusMessage",
    "debugTrace": "$DebugTrace"
    }
"@
    return $ResponseObject
}

function TriggerLogon {
    Param
    (
        [String]$EncryptedDomain,
        [String]$EncryptedUserName,
        [String]$EncryptedPassword,
        [String]$CryptoBlob,
        [String]$EncodedDllFile
    )

    $iPos = $CryptoBlob.IndexOf($DataSeparator)
    $CryptoFilePathEnc = $CryptoBlob.Substring($iPos+1)
    $CryptoFilePathByte = [System.Convert]::FromBase64String($CryptoFilePathEnc)
    $CryptoFilePath = [System.Text.Encoding]::UTF8.GetString($CryptoFilePathByte)
    $CryptoFileExpectedHash = $CryptoBlob.Substring(0, $iPos)

    function InnerTriggerLogon {
        $WindowsVersion = [System.Environment]::OSVersion
        if ($WindowsVersion.Version.Major -lt $MinimumSupportedVersion) {
            $Name = GetOperatingSystemName $WindowsVersion.Version.Major $WindowsVersion.Version.Minor $WindowsVersion.VersionString
            return CreateResponseObject 196 0 $MsgUnSupportedApp $MsgUnSupportedOS $Name
        }

        $WindowsLocked = Get-Process -Name $LogonProcess -ErrorAction SilentlyContinue
        if (!$WindowsLocked) {
            return CreateResponseObject 0 0 $MsgEmpty $MsgEmpty $MsgUnlocked
        }

        $CryptoFilePathExist = Test-Path $CryptoFilePath
        if (!$CryptoFilePathExist) {
            return CreateResponseObject 2 0 $MsgFileMissing $MsgEmpty $MsgCryptoMissing
        }

        $FileHash = GetFileHashCode($CryptoFilePath)
        $FileHashString = [System.Convert]::ToBase64String($FileHash)
        if (!$CryptoFileExpectedHash.Equals($FileHashString)) {
            return CreateResponseObject 13870 0 $MsgHashFailed $MsgEmpty $MsgCryptoNoMatch
        }

        $FileData = [System.IO.File]::ReadAllText($CryptoFilePath)
        $iPosSep = $FileData.IndexOf($DataSeparator)
        $EntropyString = $FileData.Substring(0, $iPosSep)
        $RsaPrivateKeyEncryptedString = $FileData.Substring($iPosSep+1)
        $EntropyBytes = [System.Convert]::FromBase64String($EntropyString)
        $RsaPrivateKeyEncryptedBytes = [System.Convert]::FromBase64String($RsaPrivateKeyEncryptedString)
        $RsaPrivateKeyBytes = DecryptData $RsaPrivateKeyEncryptedBytes $EntropyBytes

        $domainEncBytes = [System.Convert]::FromBase64String($EncryptedDomain)
        $userNameEncBytes = [System.Convert]::FromBase64String($EncryptedUserName)
        $passwordEncBytes = [System.Convert]::FromBase64String($EncryptedPassword)
        $decodedDllFileBytes = [System.Convert]::FromBase64String($EncodedDllFile)

        $DllFilePath = EnsureSafeTempPath
        $DllFilePath = $DllFilePath + "ControlCredentialProvider.dll"
        $fileStream = [System.IO.File]::Create($DllFilePath)
        $fileStream.Write($decodedDllFileBytes, 0, $decodedDllFileBytes.Length)
        $fileStream.Close()
        RegisterDLL $CredClassID $DllFilePath.replace('\\','\') > $null

        $RSA = New-Object System.Security.Cryptography.RSACryptoServiceProvider
        $RSA.ImportCspBlob($RsaPrivateKeyBytes)

        $decDomainBytes = $RSA.Decrypt($domainEncBytes, $false)
        $decUserNameBytes = $RSA.Decrypt($userNameEncBytes, $false)
        $decPasswordBytes = $RSA.Decrypt($passwordEncBytes, $false)
        $sDomain = [System.Text.Encoding]::UTF8.GetString($decDomainBytes)
        $sUserName = [System.Text.Encoding]::UTF8.GetString($decUserNameBytes)
        $sPassword = [System.Text.Encoding]::UTF8.GetString($decPasswordBytes)

        Stop-process -Name $LogonProcess -ErrorAction SilentlyContinue
        EnsureLogonUIRespwaned

        $pipeSecurity = New-Object System.IO.Pipes.PipeSecurity
        $pipeSecurity.SetAccessRuleProtection($true, $false)
        $pipeSecurity.AddAccessRule((New-Object System.IO.Pipes.PipeAccessRule @(
                (New-Object System.Security.Principal.SecurityIdentifier  @([System.Security.Principal.WellKnownSidType]::LocalSystemSid,$null)),`
                [System.IO.Pipes.PipeAccessRights]::FullControl,`
                [System.Security.AccessControl.AccessControlType]::Allow
            ))
        )
        $ControlPipe = New-Object System.IO.Pipes.NamedPipeServerStream(
            $PipeName,
            [System.IO.Pipes.PipeDirection]::InOut,
            1,
            [System.IO.Pipes.PipeTransmissionMode]::Message,
            [System.IO.Pipes.PipeOptions]::None,
            1024,
            1024,
            $pipeSecurity
        )
        $ControlPipe.WaitForConnection()
        $ControlStreamReader = New-Object System.IO.StreamReader $ControlPipe
        $ControlStreamWriter = New-Object System.IO.StreamWriter $ControlPipe
        $ControlStreamWriter.AutoFlush = $true

        $ControlStreamWriter.Write("0:$sDomain")
        $ControlStreamWriter.Write("1:$sUserName")
        $ControlStreamWriter.Write("2:$sPassword")

        $Status = $ControlStreamReader.ReadLine().Substring(2)
        $SubStatus = $ControlStreamReader.ReadLine().Substring(2)
        $StatusMessage = $ControlStreamReader.ReadLine().Substring(2)
        $SubStatusMessage = $ControlStreamReader.ReadLine().Substring(2)
        $ControlPipe.Dispose()

        $DebugTrace = "Logon Success"
        UnregisterDLL $CredClassID > $null
        if (($Status -ne 0) -or ($SubStatus -ne 0)) {
            $DebugTrace = "Logon Failed"
        }

        Stop-process -Name $LogonProcess -ErrorAction SilentlyContinue
        $result = CreateResponseObject $Status $SubStatus $StatusMessage $SubStatusMessage $DebugTrace
        $iDeleteRetry = 20
        while((Test-Path $DllFilePath) -and ($iDeleteRetry))
        {
            Remove-Item $DllFilePath -ErrorAction SilentlyContinue
            $iDeleteRetry--
            Start-Sleep -Milliseconds 100
        }
        return $result
    }

    $jsonResponse = InnerTriggerLogon

    $SubDirectoryPath = EnsureSafeTempPath
    $SubDirInfo = New-Object System.IO.DirectoryInfo $SubDirectoryPath
    if ($SubDirInfo.Exists) {
        $SubDirInfo.Delete($true)
    }

    $jsonResponse
}

